description:
History of the Tatras

History Documentary hosted by Milan Koren, published by Studio J+J in 2008 - English narration 
also known as
* Geschichte der Tatra
* Historia Tatr


Information
------------------------------

A documentary about the ancient and recent history of the Tatras mountain range, about its formation and exploration.

